import React from 'react';
import { View } from 'react-native';
import MeniuSus from './meniuSus';
import MeniuStanga from './MeniuStanga';
import Prezentare from './Prezentare'

export default class App extends React.Component {

  render()
  {
    return (
      <View style={{flex:1}}>
        <MeniuSus />
        <MeniuStanga />
        <Prezentare />
      </View>
    )
  }
}
